import React from "react";
import ReactDOM from "react-dom";
import "./App.css";

function App() {
  return <NavBar />;
}

function NavBar() {
  return (
    <nav>
      <ul>
        <li>Home</li>
        <li>About</li>
        <li>Love Doctor?</li>
      </ul>
    </nav>
  );
}

function MainContent() {
  return (
    <div className="content">
      <p>
        Hello there! General Kenobi! From my point of view the Jedi are evil!
      </p>
    </div>
  );
}

export default App;
